import React, { useState } from 'react'
import './main.css'
import { useNavigate } from 'react-router-dom';

function Main() {
    const navigate = useNavigate();
    const [progress, setProgress] = useState(0);
    const [reviewOrder, setReviewOrder] = useState(0);
    const handleLogout = (event) => {
        localStorage.setItem("isSigned", "false");
        localStorage.setItem("isauthorized", "");
        navigate("/");
      };

      const handleRadioChange = (value) => {
        let newProgress = 0;
    
        switch (value) {
          case 'twentyfive':
            newProgress = 25;
            setReviewOrder(1);
            break;
          case 'fifty':
            if (reviewOrder === 1) {
              newProgress = 50;
              setReviewOrder(2);
            }
            break;
          case 'seventyfive':
            if (reviewOrder === 2) {
              newProgress = 75;
              setReviewOrder(3);
            }
            break;
          case 'onehundred':
            if (reviewOrder === 3) {
              newProgress = 100;
              setReviewOrder(4);
            }
            break;
          default:
            break;
        }
    
        setProgress(newProgress);
      };
  return (
    <div>
       <nav class="navbar navbar-expand-lg navbar-dark bg-primary">
  <div class="container-fluid">
    <div class="collapse navbar-collapse" id="navbarSupportedContent">
      <ul class="navbar-nav me-auto mb-2 mb-lg-0">
        <li class="nav-link">
          <label id='h4'>Student Profile</label>
        </li>
        <li class="nav-item">
          <button class="nav-link" href="#" id='h1'>Home</button>
        </li>
        <li class="nav-item">
          <button class="nav-link" href="#" id='h2'>Link</button>
        </li>
        <li>
          <a class="nav-link" href="#" id='h3'>Project Details</a>
        </li>
      </ul>
      <form class="d-flex">
      <button class="custom-btn btn-3" value="Log Out" onClick={handleLogout}><span>Log Out</span></button>
      </form>
    </div>
  </div>
</nav>
<div class="container">

  <input type="radio" class="radio" name="progress" value="twentyfive" id="twentyfive"/>
  <label for="twentyfive" class="label">25%</label>

  <input type="radio" class="radio" name="progress" value="fifty" id="fifty"/>
  <label for="fifty" class="label">50%</label>

  <input type="radio" class="radio" name="progress" value="seventyfive" id="seventyfive"/>
  <label for="seventyfive" class="label">75%</label>

  <input type="radio" class="radio" name="progress" value="onehundred" id="onehundred"/>
  <label for="onehundred" class="label">100%</label>

  <div class="progress">
    <div class="progress-bar" style={{ width: `${progress}%` }}></div>
  </div>
</div>
<table class="table">
  <thead>
    <tr>
      <th scope="col">REVIEW 1</th>
      <th scope="col">REVIEW 2</th>
      <th scope="col">REVIEW 3</th>
      <th scope="col">REVIEW 4</th>
    </tr>
  </thead>
  <tbody>
  <tr>
            <td>
              <input
                type="radio"
                name="r1"
                onChange={() => handleRadioChange('twentyfive')}
              ></input>
            </td>
            <td>
              <input
                type="radio"
                name="r2"
                onChange={() => handleRadioChange('fifty')}
                disabled={reviewOrder < 1}
              ></input>
            </td>
            <td>
              <input
                type="radio"
                name="r3"
                onChange={() => handleRadioChange('seventyfive')}
                disabled={reviewOrder < 2}
              ></input>
            </td>
            <td>
              <input
                type="radio"
                name="r4"
                onChange={() => handleRadioChange('onehundred')}
              ></input>
            </td>
          </tr>
  </tbody>
</table>

    </div>
  );
}

export default Main
